import { React } from "react";

import "./cart-item.styles.scss";

const CartItem = ({ item }) => (
  <div className="cart-item">
    <img src={item.imageUrl} alt="item" />
    <div className="item-details">
      <span>{item.name}</span>
      <span>
        {item.quantity}x${item.price}
      </span>
    </div>
  </div>
);

export default CartItem;
